import React from 'react';
import { Link } from 'react-router-dom';
import { Menu } from 'semantic-ui-react';


const Header = () => {
	return (
		<header>
			<ul>
				<li><Link to='/'>Register</Link></li>
				<li><Link to='/employee'>Employees</Link></li>
			</ul>
		</header>
		)
}

export default Header;
